const STS = require('../lib/sts')
const { ak, sk, krn } = require('./const')

const sts = new STS({
   ak,
   sk
})

sts.assumeRole({
    roleKrn: krn,
    roleSessionName: 'node-test'
}, function (err, response) {
    console.log('-----> err', err)
    if (response) {
        console.log('-----> statusCode', response && response.statusCode)
        console.log('-----> body', response && response.body)
    }
})